	add("ballooning", "{\"term\":\"ballooning\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of something that swells or expands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Margaret McCartney, \u0027The Patient Paradox\u0027 (page 95\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This major artery from the heart to the lower body, the aorta, can indeed develop aneurysms. These \u0027\u0027balloonings\u0027\u0027 of the shape of the normally straight artery may cause no bother, no symptoms and no complications\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sport or hobby of flying in a balloon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/18/falling-upwards-richard-holmes-review Fantasy of passage\u003dLike most human activities, \u0027\u0027ballooning\u0027\u0027 has sponsored heroes and hucksters and a good deal in between. For every dedicated scientist patiently recording atmospheric pressure and wind speed while shivering at high altitudes, there is a carnival barker with a bevy of pretty girls willing to dangle from a basket or parachute down to earth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The mechanical kiting used by spiders, mites, caterpillars, etc. to travel through the air\", \"priority\":6}]}, \"synonyms\":{}}");

	add("ballot", "{\"term\":\"ballot\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"File:Ballotboxballs.jpg|thumb|Early \u0027\u0027ballot\u0027\u0027 box, using balls.From Italian {{m|it|ballotta||small ball used to register a vote}}; compare {{m|en|blackballing}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paper or card used to cast a vote\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of voting, especially in secret\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Charles Dicken\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the insufficiency of the \u0027\u0027ballot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A list of candidates running for office; a ticket\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The total of all votes cast in an election\", \"priority\":6}]}, \"synonyms\":{}}");

