	add("balrog", "{\"term\":\"balrog\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"sindarin\"], \"text\":\"From Sindarin a fictional language created by w:J.R.R. Tolkien|J.R.R. Tolkien, meaning something akin to \u0026quot;mighty demon\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fiery demonic creature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tolkien\u0027s Middle-earth\u0027) a terrible creature \u0026quot;of fire and shadow\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, J. R. R. Tolkien, \u0027The Fellowship of the Ring\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Balrog\u0027\u0027 made no answer. The fire in it seemed to die, but the darkness grew. It stepped forward slowly on to the bridge, and suddenly it drew itself up to a great height, and its wings were spread from wall to wall\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, post on newsgroup \u0027alt.sex.bondage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What was released was a demon, a \u0027\u0027balrog\u0027\u0027 of pure sexual energy which had been denied for too long\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, post on newsgroup \u0027rec.skiing.alpine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"is just a big goofy \u0027\u0027Balrog\u0027\u0027 as far as I\u0027m concerned, he might make a \u0026quot;Green Dot\u0026quot; poster scared; the big dweeb\", \"priority\":8}]}, \"synonyms\":{}}");

	add("balsa", "{\"term\":\"balsa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Basque\", \"iberian\"], \"text\":\"From Spanish \u0027balsa\u0027 from a language, probably Basque or Iberian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large tree, native to tropical America, with wood that is very light in weight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The wood of this tree\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A raft or float, used principally on the Pacific coast of South America\", \"priority\":3}]}, \"synonyms\":{}}");

	add("balsam", "{\"term\":\"balsam\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) *\u0027\u0027 (balsam) \u0027balsme\u0027 from Old english (ca. 450-1100) \u0027balsam\u0027 \u0027balsamum\u0027 (balsam, balm) from Latin \u0027balsamum\u0027 from Ancient greek (to 1453) \u0027βάλσαμον\u0027 (balsam) of origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sweet-smelling oil or resin derived from various plants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A plant or tree yielding such substance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A soothing ointment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something soothing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Classical music is a sweet \u0027\u0027balsam\u0027\u0027 for our sorrow\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A flowering plant of the genus \u0027Impatiens\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The balsam family of flowering plants (\u0027\u0027), which includes \u0027Impatiens\u0027 and\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A balsam fir \u0027Abies balsamea\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Canada balsam, a turpentine obtained from the resin of balsam fir\", \"priority\":9}]}, \"synonyms\":{}}");

