	add("baluster", "{\"term\":\"baluster\", \"etymology\":{\"influencers\":[], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"French\", \"ancient greek (to 1453)\", \"Italian\"], \"text\":\"French \u0027balustre\u0027 from Italian \u0027balaustro|lang\u003dit\u0027 () from \u0027balausta|lang\u003dit\u0027 () so named because of resemblance to the swelling form of the half-open flower, from Ancient greek (to 1453) \u0027βαλαύστιον\u0027 from (compare Official aramaic (700-300 bce) \u0027balatz\u0027 \u0027wild pomegranate flower\u0027).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A short column used in a group to support a rail, as commonly found on the side of a stairway; a banister\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d3|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dSepia Delft tiles surrounded the fireplace, their crudely drawn Biblical scenes in faded cyclamen blending with the pinkish pine, while above them, instead of a mantelshelf, there was an archway high enough to form a balcony with slender \u0027\u0027balusters\u0027\u0027 and a tapestry-hung wall behind\", \"priority\":2}]}, \"synonyms\":{}}");

	add("balustrade", "{\"term\":\"balustrade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"{{borrowing|fr|balustrade|lang\u003den}}, from Italian {{m|it|balaustrata||with balusters}}, from {{m|it|balaustro||baluster}}, from {{m|it|balausta||wild pomegranate flower}}, via Latin {{m|la|balaustium}}, from Ancient greek (to 1453) {{m|grc|βαλαύστιον}}, from (compare Aramaic {{m|arc|||tr\u003dbalatz|wild pomegranate flower}}). So named because of resemblance to the swelling form of the half-open pomegranate flower. Also see baluster.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A row of balusters topped by a rail, serving as an open parapet, as along the edge of a balcony, terrace, bridge, staircase, or the eaves of a building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027 — w:Arthur C. Arthur C. Clarke, \u0027The City and the Stars\u0027, p 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Jester sat down on one of the marble \u0027\u0027balustrades\u0027\u0027 and regarded Alvin with a curious intentness\", \"priority\":3}]}, \"synonyms\":{}}");

